#include<string>
#include<vector>
#include<unordered_map>
#include<algorithm>
#include<iostream>

using namespace std;

bool cmp(string str1, string str2) {
    return str1.size() > str2.size();
}
class Solution {
private:
    
    
    void sort_str(vector<string>& a) {
        sort(a.begin(), a.end(), cmp);
    }
    
    bool match(string& s, int start, string& m) {
        int len = m.size();
        if (start + len > s.size()) {
            return false;
        }
        for (int i = 0; i < len; i++) {
            if (s[start + i] != m[i]) {
                return false;
            }
        }
        return true;
    }
    
    void replace(string& s, int start, string& m) {
        int len = m.size();
        for (int i = 0; i < len; i++) {
            s[start + i] = m[i];
        }
    }
    
public:
    /**
     * @param a: The A array
     * @param b: The B array
     * @param s: The S string
     * @return: The answer
     */
    string stringReplace(vector<string> &a, vector<string> &b, string &s) {
        if (a.size() == 0 || b.size() == 0 || s.size() == 0) {
            return s;
        }
        /*
        unordered_map<string, string> map;
        for (int i = 0; i < a.size(); i++) {
            map[a[i]] = b[i];
        }
        sort_str(a);
        */
        for (int i = 0; i < s.size(); i++) {
            int max_len = 0;
            int idx = -1;
            for (int j = 0; j < a.size(); j++) {
                if (match(s, i, a[j])) {
                
                    if (a[j].size() > max_len) {
                        max_len = a[j].size();
                        idx = j;
                    }
        
                    /*
                    string target = map[a[j]];
                    replace(s, i, target);
                    i += target.size();
                    break;
                    */
                }
            }
            replace(s, i, b[idx]);
            i += max_len;
        }
        return s;
    }

    string stringReplace2(vector<string> &a, vector<string> &b, string &s) {
        // Write your code here
       int seed = 33;
       int mod = 1000000007;
       int ans, mxLen = -1;
       vector<int>aHash;
       vector<int>sHash;
       vector<int>base;
       for(string i: a) {
           ans = 1;
           mxLen = max(mxLen, (int)i.size());
           for(int j = 0; j < i.size(); j++) {
               ans = ((long long)ans * seed + i[j] - 'a') % mod;
           }
           aHash.push_back(ans);
       }
       ans = 1;
       sHash.push_back(ans);
       mxLen = max(mxLen, (int)s.size());
       for(int i = 0; i < s.size(); i++) {
           ans = ((long long)ans * seed + s[i] - 'a') % mod;
           sHash.push_back(ans);
       }
       ans = 1;
       base.push_back(ans);
       for(int i = 0; i < mxLen; i++) {
           ans = (long long)ans * seed % mod;
           base.push_back(ans);
       }
       for(int i = 0; i < s.size(); i++) {
           int maxLen = -1;
           int index;
           for(int j = 0; j < a.size(); j++) {
               int len = a[j].size();
               int l = i + 1;
               int r = i + len;
               if(r > s.size()) {
                   continue;
               }
               int sHashValue = (sHash[r] - (long long)base[r - l + 1] * sHash[l - 1] % mod + mod) % mod;
               int aHashValue = (aHash[j] - base[len] + mod) % mod;
               if(sHashValue == aHashValue && len > maxLen) {
                   maxLen = len;
                   index = j;
               }
           }
           if(maxLen != -1) {
               for(int j = 0; j < maxLen; j++) {
                   s[i + j] = b[index][j];
               }
               i += maxLen - 1;
           }
       }
       return s;
    }
};

int main() {
    Solution s;
    const char *arr1[] = {"ab","aba"};
    vector<string> a (arr1, end(arr1));
    const char *arr2[] = {"cc","ccc"}; 
    vector<string> b (arr2, end(arr2));
    string str("ababa");
    cout << s.stringReplace(a, b, str) << endl;
}
